schema:
{
  "tables": {
    "daily_delhi_climate_train": {
      "columns": {
        "date": {
          "type": "date",
          "description": "Date of observation in YYYY-MM-DD format"
        },
        "meantemp": {
          "type": "float",
          "description": "Mean temperature averaged out from multiple 3 hour intervals in a day. In Celsius"
        },
        "humidity": {
          "type": "float",
          "description": "Humidity value for the day (units are grams of water vapor per cubic meter volume of air)."
        },
        "wind_speed": {
          "type": "float",
          "description": "Daily mean wind speed in km/h"
        },
        "meanpressure": {
          "type": "float",
          "description": "Daily mean atmospheric pressure in millibars"
        }
      }
    }
  }
}

